// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.16;

import "./DataTypes.sol";
import "./VotingCommon.sol";
import "./UserManager.sol";

contract VotingStorage is VotingCommon {
    // Data layer
    UserManager public userManager;
    address public userManagerAddress;

    function loaduserManager(address _userManagerAddress) public {
        userManagerAddress = _userManagerAddress;
        userManager = UserManager(userManagerAddress);
    }

    // set the initial functionality of the contract
    constructor(
        address _admin,
        address _manager
    ) VotingCommon(_admin, _manager) {}

    //mapping to store univeristy data on university id
    mapping(bytes32 => University) public universityMap;
    // mapping to store election data on election id
    mapping(bytes32 => Election) public electionMap; // id => Election
    // mapping to store positions details
    mapping(bytes32 => PositionDetail) public positionMap; // id => PositionDetail

    //Event emitted after the university added
    event UniversityAdded(University university);
    //Event emitted after the university updated
    event UniversityUpdated(University university);

    // Event emitted after the election added
    event ElectionAdded(Election election);
    // Event emitted after the election updated
    event ElectionUpdated(Election election);
    // Event emitted after the election deleted
    event ElectionDeleted(bytes32 electionId);

    // Event emitted after the position added
    event PositionAdded(PositionDetail position);
    // Event emitted after the position updated
    event PositionUpdated(PositionDetail position);
    // Event emitted after the position deleted
    event PositionDeleted(bytes32 PositionId);

    // Event emitted after the position winner
    event PositionWinner(bytes32 indexed positionId, bytes32 indexed winnerId);

    // Event emitted after candidate added on the given position
    event CandidateAddedInPosition(
        PositionDetail position,
        bytes32 candidateId
    );
    // Event emitted after candidate added on the given position
    event CandidateUpdatedInPosition(
        PositionDetail position,
        bytes32 candidateId
    );

    // Event emitted after the vote cast
    event VoteCast(bytes32 voterId, bytes32 positionId);

    /*
  Function for add university
  @param detail object of the university
  */
    function addUniversity(University memory _university) public {
        if(isUniversityCreated(_university.universityId)){
            revert("University already exist");
        }
        universityMap[_university.universityId] = _university;
        emit UniversityAdded(_university);
    }

    /*
  Function for update university
  @param detail object of the university
  */
    function updateUniversity(University memory _university) public {
        if(!isUniversityCreated(_university.universityId)){
            revert("University not created");
        }
        universityMap[_university.universityId] = _university;
        emit UniversityUpdated(_university);
    }

    /*
  Function to check university id already exist or not
  @param bytes32 universityId
  */
    function isUniversityCreated(bytes32 _universityId) internal view returns(bool){
        if(universityMap[_universityId].universityId == ""){
            return false;
        }
        return true;
    }


    /*
  Function to get university detail
  @param bytes32 universityId
  */ 
    function getUniversityDetail(bytes32 _universityId) public view returns (University memory) {
        return universityMap[_universityId];
    }



    /*
  Function for add election
  @param detail object of the election
  */
    function addElection(Election memory _election) public{
        if (isElectionCreated(_election.electionId)) {
            revert("Election already created with given id");
        }
        saveElectionInMap(_election);
        emit ElectionAdded(_election);
    }

    /*
  Function for update election
  @param detail object of the election
  */
    function updateElection(Election memory _election) public {
        if (!isElectionCreated(_election.electionId)) {
            revert("Election not exist");
        }
        saveElectionInMap(_election);
        emit ElectionUpdated(_election);
    }

    /*
     * @dev Function to delete a election
     * @param electionId 12 bit uint id of the election
     */
    function deleteElection(bytes32 _electionId) public {
        Election memory election = electionMap[_electionId];
        if (election.electionId == "") {
            revert("Election does not exist");
        }
        // Delete the Election in the mapping
        delete (electionMap[_electionId]);

        // Emit the ElectionDeleted event
        emit ElectionDeleted(_electionId);
    }

    /*
  Function for stored election data in mapping internally
  @param detail object of the election
  */
    function saveElectionInMap(Election memory _election) internal {
        electionMap[_election.electionId] = Election(
            _election.universityId,
            _election.electionId,
            _election.startingTime,
            _election.endingTime + 1 weeks,
            _election.positionsDetailsId
        );
        universityMap[_election.universityId].electionIds.push(_election.electionId);
    }

    /*
  Function for check election already exist or not
  @param detail object of the election
  */
    function isElectionCreated(
        bytes32 _electionId
    ) internal view returns (bool) {
        Election memory election = electionMap[_electionId];
        if (election.electionId == "") {
            return false;
        }
        return true;
    }

    /*
  Function to get election detail
  @param election id
  */
    function getElectionDetail(
        bytes32 _electionId
    ) public view returns (Election memory) {
        return electionMap[_electionId];
    }

    /*
  Function to get election position detail
  @param election id
  */
    function getElectionPositionDetail(
        bytes32 _electionId
    ) public view returns (bytes32[] memory) {
        return electionMap[_electionId].positionsDetailsId;
    }

    /*
  Function to get election starting time
  @param election id
  */
    function getElectionStartingTime(
        bytes32 _electionId
    ) public view returns (uint256) {
        return electionMap[_electionId].startingTime;
    }

    /*
  Function to get election ending time
  @param election id
  */
    function getElectionEndingTime(
        bytes32 _electionId
    ) public view returns (uint256) {
        return electionMap[_electionId].endingTime;
    }

    /*
    POSITION DETAIL OPERATIONS
  */

    /*
  Function for add position
  @param detail object of the position
  */
    function addPosition(
        PositionDetail memory _positionDetail
    ) public {
        // check position id already not present
        if (isPositionCreated(_positionDetail.positionId)) {
            revert("Position already exist");
        }
        // save position detail into mapping
        savePositionDetailInMap(_positionDetail);
        // Emitted the event
        emit PositionAdded(_positionDetail);
    }

    /*
  Function for update position detail
  @param detail object of the position
  */
    function updatePositionDetail(
        PositionDetail memory _positionDetail
    ) public {
        // check position id already exist
        if (!isPositionCreated(_positionDetail.positionId)) {
            revert("Position not exist");
        }
        // save updated position detail in mapping
        savePositionDetailInMap(_positionDetail);
        // Emitted the event
        emit PositionUpdated(_positionDetail);
    }

    function deletePosition(bytes32 _positionId) public {
        PositionDetail memory positionDetail = positionMap[_positionId];
        // check position id already exist
        if (positionDetail.positionId == "") {
            revert("Position does not exist");
        }
        // save delete position detail in mapping
        delete (positionMap[_positionId]);
        // Emitted the event
        emit PositionDeleted(_positionId);
    }

    /*
  Function for store position detail in mapping internally
  @param detail object of the position
  */
    function savePositionDetailInMap(
        PositionDetail memory _positionDetail
    ) internal {
        positionMap[_positionDetail.positionId] = _positionDetail;
    }

    /*
  Function for check position exist or not
  @param bytes32 position id
  */
    function isPositionCreated(
        bytes32 _positionId
    ) internal view returns (bool) {
        PositionDetail memory position = positionMap[_positionId];
        if (position.positionId == "") {
            return false;
        }
        return true;
    }

    /*
  Function for get positin detail
  @param bytes32 position id
  */
    function getPositionDetail(
        bytes32 _positionId
    ) public view returns (PositionDetail memory) {
        return positionMap[_positionId];
    }

    /*
  Function for get position designation
  @param bytes32 position id
  */
    function getPositionDesignation(
        bytes32 _positionId
    ) public view returns (uint8) {
        return positionMap[_positionId].position;
    }

    /*
  Function for get positin candidates
  @param bytes32 position id
  */
    function getPositionCandidates(
        bytes32 _positionId
    ) public view returns (bytes32[] memory) {
        return positionMap[_positionId].candidatesId;
    }

    /*
  Function for get positin max vote count
  @param bytes32 position id
  */
    function getPositionMaxVote(
        bytes32 _positionId
    ) public view returns (uint256) {
        return positionMap[_positionId].maxVotes;
    }

    /*
      OTHER OPERATIONS
  */

    /*
  Function to add candidates in position id
  @param bytes32 position id
  @param bytes32 candidate id
  */
    function addCandidateInPosition(
        bytes32 _positionId,
        bytes32 _candidateId
    ) public {
        PositionDetail storage position = positionMap[_positionId];
        // Check if the position exists
        require(position.positionId != "", "Position not found");
        // Check if the candidate exists
        for (uint256 i = 0; i < position.candidatesId.length; i++) {
            if (_candidateId == position.candidatesId[i]) {
                revert("Candidate already present for this position");
            }
        }
        // Store candidate in the position struct
        position.candidatesId.push(_candidateId);
        // Emit the event
        emit CandidateAddedInPosition(position, _candidateId);
    }

    /*
  Function to delete candidates in position id
  @param bytes32 position id
  @param bytes32 candidate id
  */
    function deleteCandidateInPosition(
        bytes32 _positionId,
        bytes32 _candidateId
    ) public {
        PositionDetail storage position = positionMap[_positionId];
        // Check if the position exists
        require(position.positionId != "", "Position not found");
        position.candidatesId = deleteCandidateFromList(
            position.candidatesId,
            _candidateId
        );
    }

    function deleteCandidateFromList(
        bytes32[] memory _candidates,
        bytes32 _candidate
    ) public pure returns (bytes32[] memory) {
        uint256 currentIndex = findIndex(_candidates, _candidate);
        if (currentIndex == _candidates.length) {
            revert("Candidate not found in owner list");
        }
        for (uint256 i = currentIndex; i < _candidates.length - 1; i++) {
            _candidates[i] = _candidates[i + 1];
        }
        return deleteLastElement(_candidates);
    }

    function findIndex(
        bytes32[] memory arr,
        bytes32 element
    ) internal pure returns (uint256) {
        for (uint256 i = 0; i < arr.length; i++) {
            if (arr[i] == element) {
                return i;
            }
        }
        return arr.length;
    }

    function deleteLastElement(
        bytes32[] memory arr
    ) public pure returns (bytes32[] memory) {
        bytes32[] memory tempArray = new bytes32[](arr.length - 1);
        for (uint256 i = 0; i < tempArray.length; i++) {
            tempArray[i] = arr[i];
        }
        return tempArray;
    }

    /*
  Function to add vote cast
  @param uint256 currentIndex value
  @param bytes32 position id
  @param bytes32 candidate id
  */
    function voteCast(bytes32 _positionId, bytes32 _candidateId) public {
        Voter memory voter = userManager.getVoterDetailByAddress(msg.sender);
        Candidate memory candidate = userManager.getCandidateDetail(_candidateId);
        PositionDetail memory position = getPositionDetail(_positionId);
        PositionVote[] memory positionVote = new PositionVote[](voter.positionVote.length + 1);

        for(uint i=0; i<voter.positionVote.length; i++){
            if(voter.positionVote[i].positionId == _positionId){
                revert("Vote already exist");
            }
            positionVote[i].positionId = voter.positionVote[i].positionId;
            positionVote[i].candidateId = voter.positionVote[i].positionId;
            positionVote[i].isVoted = voter.positionVote[i].isVoted;
        }

            positionVote[voter.positionVote.length].positionId = _positionId;
            positionVote[voter.positionVote.length].candidateId = keccak256(
                    abi.encodePacked(
                        _candidateId,
                        block.timestamp,
                        block.difficulty
                    )
                );
            positionVote[voter.positionVote.length].isVoted = true;

        candidate.voteCount += 1;
        position.maxVotes += 1;

        voter.positionVote = positionVote;
        userManager.updateVoter(voter);
        userManager.updateCandidate(candidate);
        updatePositionDetail(position);
        emit VoteCast(voter.voterId, _positionId);
    }

    function validatePositionWinner(
        bytes32 _positionId
    ) public returns (uint8) {
        PositionDetail storage position = positionMap[_positionId];
        position.totalValidators += 1;
        position.validatorsAddress.push(msg.sender);
        updatePositionDetail(position);
        return position.totalValidators;
    }

    /*
  Function for winner or result
  @param bytes32 position id
  */
    function positionWinner(bytes32 _positionId) public returns (bytes32) {
        require(
            validatePositionWinner(_positionId) >= 3,
            "This function needs 3 validator approval"
        );
        PositionDetail memory position = positionMap[_positionId];
        Election memory election = getElectionDetail(position.electionId);
        require(election.endingTime == block.timestamp, "Election must be ended");
        bytes32[] memory candidates = position.candidatesId;
        uint256 totalVotes = 0;
        bytes32 winnerCandidateId;
        for (uint256 j = 0; j < candidates.length; j++) {
            uint256 candidateVoteCount = userManager.getCandidateVotes(candidates[j]);
            if (candidateVoteCount > totalVotes) {
                totalVotes = candidateVoteCount;
                winnerCandidateId = candidates[j];
                }
            }
        emit PositionWinner(_positionId, winnerCandidateId);
        return winnerCandidateId;
    }
}
